import React from "react";

class Part1Comp extends React.Component {
  constructor(props) {
  	super(props);
  	this.counter = 20;
  
}
  onClick() {
  	console.log("You clicked the button");
  }

   render() {

   	 return (
      <div>
      	<h1> Hello from Part1Comp {this.counter} </h1>

      	<button id= "btn" onClick ={this.onClick}> Push me! </button> 
      </div>
    );

   }

 }


 export default Part1Comp;
